module GlobalPollenProject.App.Seed

open System
open GlobalPollenProject.Core.DomainTypes
module U = UseCases

let ensure result =
    match result with
    | Ok r -> r
    | Error e -> failwithf "Error in seed action: %A" e

let seedTestData () =
    match U.Backbone.searchNames
              { Rank = "Species"
                LatinName = "Ternatea flagellaris"
                Family = Some "Leguminosae"
                Genus = Some "Ternatea"
                Species = Some "flagellaris"
                Authorship = Some "(Benth.)" } with
    | Ok s ->
        if s.Length = 0
        then
            printfn "The database has not been seeded. Importing seed data..."
            U.Backbone.importAll "data/plant-list-extract.txt"
            
            // Register basic user as curator
            let seedUser =
                let id = Guid.NewGuid()
                fun _ -> id
            U.User.register seedUser {
                Title = "Ms"
                FirstName = "Seed"
                LastName = "User"
                Organisation = "Global Pollen Project"
            } |> ignore
            match U.User.grantCuration () (seedUser().ToString()) with
            | Ok _ -> ()
            | Error e -> failwithf "Could not grant curation rights: %A" e
            
            // Add a sample reference collection
            let collection =
                match U.Digitise.startNewCollection seedUser
                          {
                            Name = "Sample Collection"
                            Description = "A test collection"
                            CuratorFirstNames = "Some"
                            CuratorSurname = "Curator"
                            CuratorEmail = "curator@curator.curator"
                            AccessMethod = "institution"
                            Institution = "Oxford"
                            InstitutionUrl = "https://ox.ac.uk" } with
                | Ok g -> (CollectionId g)
                | Error _ -> invalidOp "Could not start collection"
            
            let backboneTaxon =
                match U.Backbone.tryMatch
                          {
                            LatinName = "Salix lanata"
                            Rank = "Species"
                            Family = Some "Saliacaeae"
                            Genus = Some "Salix"
                            Species = Some "lanata"
                            Authorship = Some "L." } with
                | Ok b -> b.Head.Id
                | Error _ -> invalidOp "Could not find Salix lanata in backbone"

            let unwrap (CollectionId i) = i
            match U.Digitise.addSlideRecord
                      {
                        Collection = unwrap collection
                        OriginalFamily = "Saliaceae"
                        ValidatedTaxonId = backboneTaxon
                        SamplingMethod = "botanical"
                        OriginalGenus = "Salix"
                        OriginalSpecies = "lanata"
                        OriginalAuthor = "L."
                        ExistingId = ""
                        PlantIdMethod = {
                            Method = "unknown"
                            InstitutionCode = ""
                            InternalId = ""
                            IdentifiedByFirstNames = []
                            IdentifiedBySurname = "" }
                        YearCollected = Nullable<int>(2010)
                        YearSlideMade = Nullable<int>()
                        LocationType = "Country"
                        LocationLocality = ""
                        LocationDistrict = ""
                        LocationRegion = ""
                        LocationCountry = "Brazil"
                        LocationContinent = "South America"
                        PreparedByFirstNames = []
                        PreparedBySurname = ""
                        PreperationMethod = "fresh"
                        MountingMaterial = "unknown"
                        CollectedByFirstNames = [ "Test" ]
                        CollectedBySurname = "McTest" } with
            | Ok _ -> ()
            | Error e -> failwithf "Could not add slide: %A" e
            
            U.Digitise.uploadSlideImage {
                CollectionId = collection |> unwrap
                SlideId = "GPP1"
                IsFocusImage = false
                FramesBase64 = [ "data:image/png;base64," ]
                FloatingCalPointOneX = Nullable<int> 1
                FloatingCalPointOneY = Nullable<int> 1
                FloatingCalPointTwoX = Nullable<int> 10
                FloatingCalPointTwoY = Nullable<int> 10
                MeasuredDistance = Nullable<float> 0.86
                CalibrationId = Guid.NewGuid()
                Magnification = 40
                DigitisedYear = Nullable<int> 2020 } |> ensure |> ignore
            
            U.Digitise.publish seedUser ((collection |> unwrap).ToString()) |> ignore
            U.Curation.issueDecision seedUser {
                Approved = true
                Comment = "All data complete. Well documented."
                Collection = collection |> unwrap
            } |> ignore
            
            printfn "Import of seed data complete."                    
            
    | Error _ -> ()